import React, { useState } from "react";
import axios from 'axios';
import { PageHeader, Tab, Tabs, Thumbnail, Well, Panel } from "react-bootstrap";
import "./profile.css";

export default function Profile(props) {
  const [firstName, setFirstName] = useState("Kevin");
  const [lastName, setLastName] = useState("Kim");
  const [biography, setBiography] = useState("");
  const [college, setCollege] = useState("");
  const [skills, setSkills] = useState("");
  const [picture, setPicture] = useState("/profile.png");
  const [resume, setResume] = useState("");

  return (
    <div className="Profile">

      <PageHeader>
        Profile
      </PageHeader>

      <div className="photo">
        <Thumbnail src={picture} />
      </div>

      <Tabs defaultActiveKey={1} id="profileTabs">
        Hello
        <Tab eventKey={1} title="Basic Info">
          <Well>{firstName} {lastName}</Well>
          <Well>{firstName} {lastName}</Well>
        </Tab>
        <Tab eventKey={2} title="Basic Info">
          <Panel>
            <Panel.Heading>{firstName} {lastName}</Panel.Heading>
          </Panel>
        </Tab>
        <Tab eventKey={3} title="Basic Info">
          Tab 3
        </Tab>
      </Tabs>

    </div>
  );
}
